import React from "react";

import Contactito from "../components/Contactito";
import HelmetResumen from "../components/HelmetResumen";

function Contacto() {
	return (
		<section className="contacto">
			<HelmetResumen title="Contacto" />
			<h2>Contacto</h2>
			<Contactito />
		</section>
	);
}

export default Contacto;
